        <input
          type="text"
          value={username}
          onChange={(e) => setUsername(e.target.value)}
          className="auth-input"
        />
      </div>
      <div>
        <label>Password:</label>
        <input
          type="password"
          value={password}
          onChange={(e) => setPassword(e.target.value)}
          className="auth-input"
        />
      </div>
      <button onClick={handleLogin} className="auth-button">
        Login
      </button>
      {error && <p className="auth-error">{error}</p>}
    </div>
  );
}
